function romanToInt(s){
  let result = 0;
  const numd = {"I": 1, "V": 5, "X": 10,
   "L": 50, "C": 100, "D": 500, "M": 1000};
  for (let i =0; i<s.length; i++){
    let g =  s.charAt(i);
    if(numd[g] < numd[s.charAt(i+1)]){
      result-= numd[g];
    }else{
      result += numd[g];
    }
  }
  return result;
}

